import React, { useEffect, useState } from 'react';

function UserTable() {
  const [users, setUsers] = useState([]);
  const [address, setAddress] = useState([]);

  const fetchData = async () => {
    const response = await fetch('https://localhost:8000/api/user-name')
    const name = await response.json()
    response = await fetch('https://localhost:8000/api/address-name')
    const address = await response.json()
    console.log()
    setUsers(name)
    setAddress(address)
  } 

  useEffect(() => {
    fetchData();
  }, []);

  console.log(users, address)
  return (
    <div>
      <h1>User List</h1>
      <table border="1">
        <thead>
          <tr>
            <th>Name</th>
            <th>Address</th>
          </tr>
        </thead>
        <tbody>
          {users.map((user, index) => (
            <tr key={index}>
              <td>{user.name}</td>
              <td>{address.address}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default UserTable;
